import React from 'react';
import { Link } from 'react-router-dom';

const MemeCard = ({ meme }) => {
    return (
        <Link to={`/caption/${meme.id}`}>
        <img src={meme.url} alt={meme.name} />
        <p>{meme.name}</p>
      </Link>
    );
  };

  export default MemeCard;





